            return 1
        }
        if (a.category < b.category) {
            return -1
        }
        return 0
    })

    let rows = []
    let currentCategory = undefined




    return (
        <>
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Price ($)</th>
                    </tr>
                </thead>
                <tbody>
                    <ProductCategoryRow
                        data={props.data}
                        onOnlyInStockChange={props.onOnlyInStockChange}
                        onFilterTextChange={props.onFilterTextChange}
                    />
                </tbody>
            </table>
        </>
    )
}
